import React from 'react'

function box_content() {
    return (
        <div>
            <nav class aria-label="breadcrumb">
                <ol class="breadcrumb">
                    <li class="active breadcrumb-item" aria-current="page">
                        Blue
                    </li>
                </ol>
            </nav>
        </div>
    );
}

export default box_content
